[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#Contingency-tables","page":"API","title":"Contingency tables","text":"","category":"section"},{"location":"api/#MetidaFreq.contab","page":"API","title":"MetidaFreq.contab","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.contab","category":"page"},{"location":"api/#MetidaFreq.contab","page":"API","title":"MetidaFreq.contab","text":"contab(m::AbstractMatrix{Int};\n    rownames::Union{Vector{String}, Nothing} = nothing,\n    colnames::Union{Vector{String}, Nothing} = nothing,\n    id::Dict = Dict())\n\n\n\n\n\ncontab(v::AbstractVector{Int};\n    rownames::Union{Vector{String}, Nothing} = nothing,\n    colnames::Union{Vector{String}, Nothing} = nothing,\n    id::Dict = Dict())\n\n\n\n\n\ncontab(ct::ConTab, rr, cr)\n\nMake ConTab with ct, rows rr and columns cr.\n\n\n\n\n\ncontab(data, row::Symbol, col::Symbol; sort::Union{Nothing, Symbol, AbstractVector{Symbol}} = nothing, id = nothing)\n\nMake contingency table from data using row and col columns.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.freq","page":"API","title":"MetidaFreq.freq","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.freq","category":"page"},{"location":"api/#MetidaFreq.freq","page":"API","title":"MetidaFreq.freq","text":"freq(data, col; id = Dict())\n\n\n\n\n\n","category":"function"},{"location":"api/#Contingency-tables-utilities","page":"API","title":"Contingency tables utilities","text":"","category":"section"},{"location":"api/#MetidaFreq.addcol","page":"API","title":"MetidaFreq.addcol","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.addcol","category":"page"},{"location":"api/#MetidaFreq.addcol","page":"API","title":"MetidaFreq.addcol","text":"addcol(ct::ConTab, col::Vector{Int}; coln = \"Val\")\n\n\n\n\n\naddcol(f::Function, ct::ConTab; coln = \"Val\")\n\n\n\n\n\naddcol(f::Function, ct::ConTab, col::Vector{Int}; coln = \"Val\")\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.colreduce","page":"API","title":"MetidaFreq.colreduce","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.colreduce","category":"page"},{"location":"api/#MetidaFreq.colreduce","page":"API","title":"MetidaFreq.colreduce","text":"colreduce(f::Function, data::DataSet{<:ConTab}; coln = nothing)\n\n\n\n\n\n","category":"function"},{"location":"api/#Base.permutedims","page":"API","title":"Base.permutedims","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.permutedims","category":"page"},{"location":"api/#Base.permutedims","page":"API","title":"Base.permutedims","text":"Base.permutedims(ct::ConTab)\n\nConTab permutedims.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.sumrows","page":"API","title":"MetidaFreq.sumrows","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.sumrows","category":"page"},{"location":"api/#MetidaFreq.sumrows","page":"API","title":"MetidaFreq.sumrows","text":"sumrows(f::Function, contab::ConTab; coln = \"Val\")\n\n\n\n\n\nsumrows(contab::ConTab; coln = \"Val\")\n\n\n\n\n\n","category":"function"},{"location":"api/#Confidence-Intervals","page":"API","title":"Confidence Intervals","text":"","category":"section"},{"location":"api/#MetidaFreq.confint","page":"API","title":"MetidaFreq.confint","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.confint","category":"page"},{"location":"api/#StatsAPI.confint","page":"API","title":"StatsAPI.confint","text":"StatsBase.confint(mpr::MetaPropResult; level = 0.95)\n\nConfidence interval for pooled proportion.\n\n!!! Warn     Results are in log-scale for OR and RR. \n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.propci","page":"API","title":"MetidaFreq.propci","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.propci","category":"page"},{"location":"api/#MetidaFreq.propci","page":"API","title":"MetidaFreq.propci","text":"propci(x::Int, n::Int; level = 0.95, method = :default)\n\nmethod:\n\n:wilson | :default - Wilson's confidence interval (CI) for a single proportion (wilson score) (Wilson, 1927);\n:wilsoncc - Wilson's CI with continuity correction (CC);\n:cp - Clopper-Pearson exact CI (Clopper&Pearson, 1934);\n:blaker - Blaker exact CI for discrete distributions (Blaker, 2000);\n:soc - SOC: Second-Order corrected CI;\n:arc - Arcsine CI;\n:wald - Wald CI without CC;\n:waldcc - Wald CI with CC;\n:ac - Agresti-Coull;\n:jeffrey - Jeffreys interval.\n\nReference:\n\nWilson, E.B. (1927) Probable inference, the law of succession, and statistical inference J. Amer.Stat. Assoc 22, 209–212;\nClopper, C. and Pearson, E.S. (1934) The use of confidence or fiducial limits illustrated in the caseof the binomial.Biometrika26, 404–413;\nBlaker, H. (2000). Confidence curves and improved exact confidence intervals for discrete distributions, Canadian Journal of Statistics 28 (4), 783–798;\n\n\n\n\n\npropci(contab::ConTab; level = 0.95, method = :default)\n\n\n\n\n\npropci(prop::Proportion; level = 0.95, method = :default)\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.diffci","page":"API","title":"MetidaFreq.diffci","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.diffci","category":"page"},{"location":"api/#MetidaFreq.diffci","page":"API","title":"MetidaFreq.diffci","text":"diffci(x1, n1, x2, n2; level = 0.95, method = :default)\n\nProportion difference (x1 / n1 - x2 / n2) confidence interval.\n\n'method'\n:mn | :default- Miettinen & Nurminen;  Miettinen, O. and Nurminen, M. (1985), Comparative analysis of two rates. Statist. Med., 4: 213-226. doi:10.1002/sim.4780040211;\n:fm | :mee - Mee maximum likelihood method; Mee RW (1984) Confidence bounds for the difference between two probabilities,Biometrics40:1175-1176\n:wald - Wald CI without CC;\n:waldcc - Wald CI with CC;\n:nhs  - Newcombes Hybrid (wilson) Score interval; Newcombe RG (1998), Interval Estimation for the Difference Between Independent Proportions: Comparison of Eleven Methods. Statistics in Medicine 17, 873-890;\n:nhscc - Newcombes Hybrid Score CC; Newcombe (1998);\n:ac -  Agresti-Caffo interval; Agresti A, Caffo B., “Simple and effective confidence intervals for proportions and differences of proportions result from adding two successes and two failures”, American Statistician 54: 280–288 (2000);\n:ha - Hauck-Andersen; Hauck, W. W., & Anderson, S. (1986). A Comparison of Large-Sample Confidence Interval Methods for the Difference of Two Binomial Probabilities. The American Statistician, 40(4), 318–322. doi:10.1080/00031305.1986.10475426 ;\n:mover - Method of variance estimates recovery;\n:jeffrey - Brown, Li's Jeffreys.\n\nReference:\n\nBrown, L.D., Cai, T.T., and DasGupta, A. Interval estimation for a binomial proportion. Statistical Science, 16(2):101–117, 2001.\nFarrington, C. P. and Manning, G. (1990), “Test Statistics and Sample Size Formulae for Comparative Binomial Trials with Null Hypothesis of Non-zero Risk Difference or Non-unity Relative Risk,” Statistics in Medicine, 9, 1447–1454\nLi HQ, Tang ML, Wong WK. Confidence intervals for ratio of two Poisson rates using the methodof variance estimates recovery. Computational Statistics 2014; 29(3-4):869-889\nBrown, L., Cai, T., & DasGupta, A. (2003). INTERVAL ESTIMATION IN EXPONENTIAL FAMILIES. Statistica Sinica, 13(1), 19-49.\n\n\n\n\n\ndiffci(contab::ConTab; level = 0.95, method = :default)\n\nConTab 2X2:\n\nA | B\n--|--\nC | D\n\nDifference: A / (A + B) - C / (C + D)\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.orci","page":"API","title":"MetidaFreq.orci","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.orci","category":"page"},{"location":"api/#MetidaFreq.orci","page":"API","title":"MetidaFreq.orci","text":"orci(x1, n1, x2, n2; level = 0.95, method = :default)\n\n:mn - MN Score (Miettinen&Nurminen, 1985);\n:fm | :mee - FM (same as MN Score, but not multiplied on (n1 + n2) * (n1 + n2 - 1)) (Mee RW, 1984; Farrington&Manning, 1990);\n:woolf - Woolf logit (Woolf, 1955);\n:awoolf - Adjusted Woolf interval (Gart adjusted logit) (Gart, 1966; Lawson, 2005);\n:mover - Method of variance estimates recovery (MOVER) (Donner&Zou, 2012);\n\nReference:\n\nMiettinen O. S., Nurminen M. (1985) Comparative analysis of two rates.Statistics in Medicine 4,213–226;\nMee RW (1984) Confidence bounds for the difference between two probabilities,Biometrics 40:1175-1176;\nFarrington, C. P. and Manning, G. (1990), “Test Statistics and Sample Size Formulae for Comparative Binomial Trials with Null Hypothesis of Non-zero Risk Difference or Non-unity Relative Risk,” Statistics in Medicine, 9, 1447–1454;\nWoolf, B. (1955). On estimating the relation between blood group and disease. Annals of human genetics, 19(4):251-253;\nGart, J. J. (1966). Alternative analyses of contingency tables. Journal of the Royal Statistical Society. Series B (Methodological), 28:164-179;\nLawson, R (2005). Smallsample confidence intervals for the odds ratio.  Communication in Statistics Simulation and Computation, 33, 1095-1113;\nDonner, A. and Zou, G. (2012). Closed-form confidence intervals for functions of the normal mean and standard deviation. Statistical Methods in Medical Research, 21(4):347-359.\n\n\n\n\n\norci(contab::ConTab; level = 0.95, method = :default)\n\nA | B\n--|--\nC | D\n\nOdd ratio: (A / B) / (C / D)\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.rrci","page":"API","title":"MetidaFreq.rrci","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.rrci","category":"page"},{"location":"api/#MetidaFreq.rrci","page":"API","title":"MetidaFreq.rrci","text":"rrci(x1, n1, x2, n2; level = 0.95, method = :default)\n\n:mn - Miettinen-Nurminen Score interval (Miettinen&Nurminen, 1985);\n:fm | :mee - FM Score interval (Mee RW, 1984; Farrington&Manning, 1990);\n:cli - Crude log interval, Gart (Gart&Nam, 1988);\n:li | :wald - Log interval / Katz / Wald interval (Katz et al, 1978);\n:mover - Method of variance estimates recovery (Donner&Zou, 2012);\n\nReference:\n\nMiettinen, O. and Nurminen, M. (1985), Comparative analysis of two rates. Statist. Med., 4: 213-226. doi:10.1002/sim.4780040211;\nMee RW (1984) Confidence bounds for the difference between two probabilities,Biometrics 40:1175-1176;\nFarrington, C. P., & Manning, G. (1990). Test statistics and sample size formulae for comparative binomial trials with null hypothesis of non-zero risk difference or non-unity relative risk. Statistics in Medicine, 9(12), 1447–1454. doi:10.1002/sim.4780091208;\nGart, JJ and Nam, J (1988): Approximate interval estimation of the ratio of binomial parameters: Areview and corrections for skewness. Biometrics 44, 323-338;\nKatz D, Baptista J, Azen SP and Pike MC. Obtaining confidence intervals for the risk ratio in cohort studies. Biometrics 1978; 34: 469–474;\nDonner, A. and Zou, G. (2012). Closed-form confidence intervals for functions of the normal mean and standard deviation. Statistical Methods in Medical Research, 21(4):347-359.\n\n\n\n\n\nrrci(contab::ConTab; level = 0.95, method = :default)\n\nA | B\n--|--\nC | D\n\nRisk ratio: (A / (A + B)) / (C / (C + D)\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.mpropci","page":"API","title":"MetidaFreq.mpropci","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.mpropci","category":"page"},{"location":"api/#MetidaFreq.mpropci","page":"API","title":"MetidaFreq.mpropci","text":"mpropci(contab::ConTab; level = 0.95, method = :default)\n\nMultinomial proportions confidence interval.\n\nmethod:\n\ngoodman | default Goodman, L.A. (1965). On Simultaneous Confidence Intervals for Multinomial Proportions. Technometrics 7: 247-254.\n\n\n\n\n\n","category":"function"},{"location":"api/#Meta-analysis","page":"API","title":"Meta-analysis","text":"","category":"section"},{"location":"api/#MetidaFreq.metaprop","page":"API","title":"MetidaFreq.metaprop","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.metaprop","category":"page"},{"location":"api/#MetidaFreq.metaprop","page":"API","title":"MetidaFreq.metaprop","text":"metaprop(d, metric; adj = 0)\n\nMeta-analysis for 2x2 tables. Where:\n\nd: `DataSet{ConTab}\n\nmetric:\n\n:rr (Risk Ratio)\n:or (Odd Ratio)\n:diff (Risk Difference)\n\nadj - adjustment value.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.metapropfixed","page":"API","title":"MetidaFreq.metapropfixed","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.metapropfixed","category":"page"},{"location":"api/#MetidaFreq.metapropfixed","page":"API","title":"MetidaFreq.metapropfixed","text":"metapropfixed(mp; weights = :default)\n\nInverce Variance method used by default.\n\nweights:\n\n:iv | :default (Inverce Variance)\n:mh (Mantel Haenszel)\n\nFor Risk Difference Sato, Greenland, & Robins (1989) modification for variance estimation used. \n\n*Results for RR and OR are in log-scale.**\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaFreq.metaproprandom","page":"API","title":"MetidaFreq.metaproprandom","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaFreq.metaproprandom","category":"page"},{"location":"api/#MetidaFreq.metaproprandom","page":"API","title":"MetidaFreq.metaproprandom","text":"metaproprandom(mp; tau = :default)\n\ntau - τ² calculation method:\n\n:dl DerSimonian-Laird (by default)\n:ho Hedges - Olkin\n:hm Hartung and Makambi (Veroniki et al. 2016)\n:sj Sidik and Jonkman\n:ml Maximum likelihood (ML) method (Veroniki et al. 2016)\n:reml Restricted maximum likelihood (REML) method (Veroniki et al. 2016)\n\n\n\n\n\n","category":"function"},{"location":"api/#HypothesisTests","page":"API","title":"HypothesisTests","text":"","category":"section"},{"location":"api/#HypothesisTests.ChisqTest","page":"API","title":"HypothesisTests.ChisqTest","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"HypothesisTests.ChisqTest","category":"page"},{"location":"api/#HypothesisTests.ChisqTest","page":"API","title":"HypothesisTests.ChisqTest","text":"HypothesisTests.ChisqTest(contab::ConTab)\n\n\n\n\n\n","category":"function"},{"location":"api/#HypothesisTests.MultinomialLRTest","page":"API","title":"HypothesisTests.MultinomialLRTest","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"HypothesisTests.MultinomialLRTest","category":"page"},{"location":"api/#HypothesisTests.MultinomialLRTest","page":"API","title":"HypothesisTests.MultinomialLRTest","text":"HypothesisTests.MultinomialLRTest(contab::ConTab)\n\n\n\n\n\n","category":"function"},{"location":"api/#HypothesisTests.FisherExactTest","page":"API","title":"HypothesisTests.FisherExactTest","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"HypothesisTests.FisherExactTest","category":"page"},{"location":"api/#HypothesisTests.FisherExactTest","page":"API","title":"HypothesisTests.FisherExactTest","text":"HypothesisTests.FisherExactTest(contab::ConTab)\n\n\n\n\n\n","category":"type"},{"location":"contab/#Contingency-tables","page":"Contingency tables","title":"Contingency tables","text":"","category":"section"},{"location":"contab/","page":"Contingency tables","title":"Contingency tables","text":"Contingency tables can be constructed with contab method:","category":"page"},{"location":"contab/","page":"Contingency tables","title":"Contingency tables","text":"using MetidaFreq\ncontab(metadf, :group, :result; sort = :trial)","category":"page"},{"location":"contab/","page":"Contingency tables","title":"Contingency tables","text":"Where metadf - DataFrame or Table,  :group - row, :result - column. ","category":"page"},{"location":"contab/","page":"Contingency tables","title":"Contingency tables","text":"If you need separate tablel by value of some factor(s) - you can define sort value.","category":"page"},{"location":"ci/#Confidence-Intervals","page":"Confidence intervals","title":"Confidence Intervals","text":"","category":"section"},{"location":"ci/","page":"Confidence intervals","title":"Confidence intervals","text":"Confidence intervals for 2X2 tables (for RD, RR, OR) and meta-analysis can be obtained with  propci, diffci, orci, rrci, confint method.","category":"page"},{"location":"details/#Details","page":"Details","title":"Details","text":"","category":"section"},{"location":"details/","page":"Details","title":"Details","text":"TBD","category":"page"},{"location":"examples/#Examples","page":"Examples","title":"Examples","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"using DataFrames","category":"page"},{"location":"examples/#Simple-contingency-table","page":"Examples","title":"Simple contingency table","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"using MetidaFreq, CSV, DataFrames;\n\ndf = CSV.File(joinpath(dirname(pathof(MetidaFreq)), \"..\", \"test\", \"csv\",  \"ft.csv\")) |> DataFrame\n\nct = MetidaFreq.contab(df, :row, :col)","category":"page"},{"location":"examples/#Confidence-Intervals","page":"Examples","title":"Confidence Intervals","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.propci(ct, method = :cp)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.diffci(ct)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.orci(ct)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.rrci(ct)","category":"page"},{"location":"examples/#Sorting-example","page":"Examples","title":"Sorting example","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"ct = MetidaFreq.contab(df, :row, :col; sort = :s1)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"ct = MetidaFreq.contab(df, :row, :col; sort = [:s1, :s2])","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.dropzeros!(ct)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"MetidaFreq.dropzeros!(ct)","category":"page"},{"location":"examples/#Meta-analysis","page":"Examples","title":"Meta-analysis","text":"","category":"section"},{"location":"examples/","page":"Examples","title":"Examples","text":"pf1 = MetidaFreq.contab([15 8; 5 14])\npf2 = MetidaFreq.contab([45 72; 23 95])\nmds = MetidaFreq.DataSet([pf1, pf2])","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"mp = MetidaFreq.metaprop(mds, :rr)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"mpf = MetidaFreq.metapropfixed(mp; weights = :mh)","category":"page"},{"location":"examples/","page":"Examples","title":"Examples","text":"mpf = MetidaFreq.metaproprandom(mp; tau = :dl)","category":"page"},{"location":"meta/#Meta-analysis","page":"Meta-analysis","title":"Meta-analysis","text":"","category":"section"},{"location":"meta/","page":"Meta-analysis","title":"Meta-analysis","text":"References:","category":"page"},{"location":"meta/","page":"Meta-analysis","title":"Meta-analysis","text":"Mantel, N., & Haenszel, W. (1959) Statistical aspects of the analysis of data from retrospective studies of disease. Journal of the National Cancer Institute, 22, 719-748.\nHedges, L. (1981) Distribution theory for Glass's estimator of effect size and related estimators. Journal of Educational Statistics, 6, 107-128\nDerSimonian, R. & Laird, N. (1986) Meta-analysis in clinical trials. Controlled Clinical Trials, 7, 177–188.\nSidik, K. & Jonkman, J. N. (2005a) A note on variance estimation in random effects meta-regression. Journal of Biopharmaceutical Statistics, 15, 823–838.\nSidik, K. & Jonkman, J. N. (2005b) Simple heterogeneity variance estimation for meta-analysis. Journal of the Royal Statistical Society, Series C, 54, 367–384.\nYusuf, S., Peto, R., Lewis, J., Collins, R., & Sleight, P. (1985). Beta blockade during and after myocardial infarction: An overview of the randomized trials. Progress in Cardiovascular Disease, 27, 335-371.\nHartung, J. & Makambi, K.H.. (2002). Positive estimation of the between-study variance meta-analysis. South African Statistical Journal. 36. \nVeroniki, A. A., Jackson, D., Viechtbauer, W., Bender, R., Bowden, J., Knapp, G., Kuss, O., Higgins, J. PT., Langan, D., and Salanti, G. (2016) Methods to estimate the between-study variance and its uncertainty in meta-analysis. Res. Syn. Meth., 7: 55– 79. doi: 10.1002/jrsm.1164.\nmetafor: Viechtbauer, Wolfgang. \"Conducting meta-analyses in R with the metafor package.\" Journal of 36 (2010).\nOpenMetaAnalyst: Wallace, Byron C., Issa J. Dahabreh, Thomas A. Trikalinos, Joseph Lau, Paul Trow, and Christopher H. Schmid. \"Closing the Gap between Methodologists and End-Users: R as a Computational Back-End.\" Journal of Statistical Software 49 (2012): 5.\"","category":"page"},{"location":"#MetidaFreq","page":"Home","title":"MetidaFreq","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = MetidaFreq","category":"page"},{"location":"","page":"Home","title":"Home","text":"Metida frequency tables. This package allows computing frequency tables, a.k.a. contingency or pivot tables. Also it allow to compute confidence intervals (simple, difference, odd ratio, risk ratio) for proportion and multinominal variabels.","category":"page"},{"location":"","page":"Home","title":"Home","text":"*This program comes with absolutely no warranty. No liability is accepted for any loss and risk to public health resulting from use of this software.","category":"page"},{"location":"#Contents","page":"Home","title":"Contents","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Pages = [\n\"index.md\",\n\"contab.md\",\n\"ci.md\",\n\"ht.md\",\n\"meta.md\",\n\"examples.md\",\n\"details.md\",\n\"api.md\"\n      ]\nDepth = 3","category":"page"},{"location":"#Reference","page":"Home","title":"Reference","text":"","category":"section"},{"location":"ht/#HypothesisTests","page":"HypothesisTests","title":"HypothesisTests","text":"","category":"section"},{"location":"ht/","page":"HypothesisTests","title":"HypothesisTests","text":"Interfaces for HypothesisTests.ChisqTest, HypothesisTests.MultinomialLRTest, HypothesisTests.FisherExactTest are provided.","category":"page"}]
